--  DDL for View V_CUSTOMER_PARTNER
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "SWAPCOM"."V_CUSTOMER_PARTNER" ("CUSTOMER_PARTNER_CODE", "CREATED_BY", "CREATED_TIME", "MODIFIED_BY", "MODIFIED_TIME", "BRANCH_ID", "BRANCH_NAME", "FULL_NAME", "ACCOUNT_NO", "CIF_NO", "TAX_CODE", "ADDRESS", "SHORT_NAME", "STATUS", "EMAIL", "MOBILE", "CUST_TYPE") AS 
  select c.customer_code CUSTOMER_PARTNER_CODE,
       c.created_by ,
       c.created_time ,
       c.modified_by ,
       c.modified_time ,
       c.branch_id,
       b.branch_name,
       c.full_name full_name,
       c.account_no account_no,
       c.cif_no cif_no,
       c.tax_code tax_code,
       c.address address,
       c.short_name short_name,
       c.status status,
       c.email email,
       c.mobile mobile,
       c.cust_type cust_type
        from scustomer c
        left join sbranch b on b.branch_id = c.branch_id
 union all
select p.partner_code CUSTOMER_PARTNER_CODE,
       p.created_by ,
       p.created_time ,
       p.modified_by ,
       p.modified_time ,
       p.branch_id,
       b.branch_name,
       p.full_name full_name,
       p.account_no account_no,
       p.cif_no cif_no,
       p.tax_code,
       p.address,
       p.short_name short_name,
       p.status status,
       p.email,
       p.mobile,
       p.cust_type cust_type
        from spartner p
      left join sbranch b on b.branch_id = p.branch_id
        order by modified_time desc
;
